import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

function Burgers() {
  return (
    <Row  xs={1} md={3} className="g-6">
      {Array.from({ length: 6 }).map((_, idx) => (
        <Col>
          <Card style={{maxWidth:'300px',alignItems:'center',justifyContentmarginTop:'10%'}}>
            <Card.Img variant="top" src="https://www.seriouseats.com/thmb/lJzVhOHzO1eTyzKK9SBVhqqGzv0=/1500x1125/filters:fill(auto,1)/__opt__aboutcom__coeus__resources__content_migration__serious_eats__seriouseats.com__recipes__images__2014__09__20140918-jamie-olivers-comfort-food-insanity-burger-david-loftus-f7d9042bdc2a468fbbd50b10d467dafd.jpg" />
            <Card.Body>
              <Card.Title>Burger {idx+1}</Card.Title>
              <Card.Text>
                Price: 3$
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
      ))}
    </Row>
  );
}

export default Burgers;
